import React, { useContext } from "react";
import { SearchContext } from "../contexts/searchContext";

const UserList = () => {
	const searchContext = useContext(SearchContext)
  const { userList } = searchContext
	return (
			<>
				{userList.length > 0} ? 
			</>
	);
}

export default UserList;
